import SocialMediasList from "./SocialMediasList"
import { createUseStyles } from "react-jss";
import { colors, container } from "../../style/globalStyle";


const FooterBottom = () => {

    const styles = createUseStyles({
        footerBottomElement: {
            backgroundColor: colors.blackBlue,
        },
        container

    });

    const classes = styles()

    return (
        <div className={classes.footerBottomElement}>
            <div className={classes.container}>
                <div className="footer-bottom__inner">
                    <p className="footer-bottom__copyright">© 2010-2019 Компания "Техномарт"<br />Все права защищены</p>
                    <SocialMediasList></SocialMediasList>
                    <div className="footer-bottom__contacts-box">
                        <p className="footer-bottom__contacts">Обратная связь:<br /><a className="footer-bottom__link"
                            href="link">mail@htmlacademy.ru</a></p>
                        <p className="footer-bottom__contacts">Разработано:<br /><a className="footer-bottom__link"
                            href="link">htmlacademy.ru</a></p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default FooterBottom
